question:
Determine the smallest non-negative integer $a$ that satisfies the congruences: \begin{align*}
&a\equiv 2\pmod 3,\\
&a\equiv 4\pmod 5,\\
&a\equiv 6\pmod 7,\\
&a\equiv 8\pmod 9.
\end{align*}

expected_output:
The ones digit of $3^1$ is 3, the ones digit of $3^3$ is 7, the ones digit of $3^5$ is 3, the ones digit of $3^7$ is 7, and so on.  Write ``$\equiv$'' to mean ``has the same ones digit as.'' Then  \begin{align*}
3^1+3^3+\cdots+3^{2009}&\equiv 3 + 7 + 3 + 7 + \cdots + 3 + 7 + 3 \\
&\equiv 0 + 0 + \cdots + 0 + 3 \\
&=\boxed{3}.
\end{align*}

question:
Determine the number of integers $x$ such that $0\le x< 12$ and $x$ satisfies the following system of equations: \begin{align*}
&x-1\equiv 1-x\pmod {12},\\
&x-2\equiv 2-x\pmod{12}.
\end{align*}

If $a,b,c$ are positive integers less than $13$ such that \begin{align*}
2ab+bc+ca&\equiv 0\pmod{13}\\
ab+2bc+ca&\equiv 6abc\pmod{13}\\
ab+bc+2ca&\equiv 8abc\pmod {13}
\end{align*}then determine the remainder when $a+b+c$ is divided by $13$.

expected_output:
We can line up the numbers and subtract just as we do in base 10.  For example, when we borrow from the $3^1$s place, the digit 1 in the units place becomes $4$, while the digit in the $3^1$s place decreases by 1. Continuing in this way, we find $$\begin{array}{c@{}c@{}c@{}c@{}c}
& \cancelto{1}{2} & \cancelto{4}{1} & \cancelto{1}{2} & \cancelto{4}{1}_3 \\
-& & 2 & 1 & 2_3 \\
\cline{2-5}
& 1 & 2 & 0 & 2_3 \\
\end{array}$$So the difference is $\boxed{1202_3}$.

Since $39 = 2 \times 18 + 3$, the $39$th digit past the decimal point is the same as the $3$rd digit past the decimal point. To find this, we can directly divide: $$
\begin{array}{c|cccc}
\multicolumn{2}{r}{0} & .0 & 5 & 2 \\
\cline{2-5}
19 & 1 & .0 & 0 & 0 \\
\multicolumn{2}{r}{} & 9 & 5 & \downarrow \\ \cline{2-4}
\multicolumn{2}{r}{} & & 5 & 0 \\
\multicolumn{2}{r}{} & & 3 & 8 \\ \cline{4-5}
\multicolumn{2}{r}{} & & 1 & 2 \\
\end{array} $$ Thus, the answer is $\boxed{2}$.

